//DO NOT DELETE CSS FILES AND SCRIPTS ARE ATTATCH!!!========
import Header from "../../components/admin/partials/Header";
import Footer from "../../components/admin/partials/Footer";
//==========================================================
import "../../assets/css/myCss.css";
export default function AdminLayout(props) {
    return (
        <>
            <div>
                <div className="container-scroller">
                    {/* partial:../../partials/_navbar.html */}
                    <nav className="navbar default-layout col-lg-12 col-12 p-0 fixed-top d-flex flex-row">
                        <div className="text-center navbar-brand-wrapper d-flex align-items-top justify-content-center">
                            <a className="navbar-brand brand-logo" href="/dependents/all">
                                {/* <img src="../../../assets/images/logo.svg" alt="logo" />  */}
                                <h1>Sun notes</h1>
                            </a>
                            {/* <a className="navbar-brand brand-logo-mini" href="../../index.html">
<h1>Sun Norest</h1> </a> */}
                        </div>
                        <div className="navbar-menu-wrapper d-flex align-items-center">
                            {/* <ul className="navbar-nav">

                            </ul> */}
                           
                            <button className="navbar-toggler navbar-toggler-right d-lg-none align-self-center" type="button" data-toggle="offcanvas">
                                <span className="mdi mdi-menu" />
                            </button>
                        </div>
                    </nav>
                    {/* partial */}
                    <div className="container-fluid page-body-wrapper">
                        {/* partial:../../partials/_sidebar.html */}
                        <nav className="sidebar sidebar-offcanvas" id="sidebar">
                            <ul className="nav">
                                {/* <li className="nav-item nav-category">Main Menu</li> */}
                                <li className="nav-item">
                                    <a className="nav-link" href="../../index.html">
                                        <i className="menu-icon typcn typcn-document-text" />
                                        <span className="menu-title">Dashboard</span>
                                    </a>
                                </li>
                            </ul>
                        </nav>
                        {/* partial */}
                        <div className="main-panel">
                            <div className="content-wrapper">
                                {props.children}
                            </div>
                            {/* content-wrapper ends */}
                            {/* partial:../../partials/_footer.html */}
                            <footer className="footer">
                                <div className="container-fluid clearfix">
                                    <span className="text-muted d-block text-center text-sm-left d-sm-inline-block">Copyright Â© 2020 <a href="https://mccoywebdevelopment.com/" target="_blank">mccoywebdevelopment</a>. All rights reserved.</span>
                                </div>
                            </footer>
                            {/* partial */}
                        </div>
                        {/* main-panel ends */}
                    </div>
                    {/* page-body-wrapper ends */}
                </div>
            </div>
        </>
    );
}
